import React from 'react';
import './App.css';
import catalog from './catalog';
import Card from './Card';
import Navbar from './Navbar';
import Adve from './Adve';

function createCard(catalog) {
  return (
    <Card
      key={catalog.id}
      productName={catalog.productName}
      imgUrl={catalog.imgUrl}
      price={catalog.price}
    />
  );
}


function App() {
  return

    <Navbar />

  ;
}

export default App;

